import React from "react";

const Contact = () => {
  return (
    <main className="contact">
      <h2>Contact Us</h2>
      <form>
        <label>Name:</label>
        <input type="text" required />
        <label>Email:</label>
        <input type="email" required />
        <label>Message:</label>
        <textarea rows="5" required></textarea>
        <button type="submit">Submit</button>
      </form>
    </main>
  );
};

export default Contact;
